import React from 'react';
import { ThemeProvider } from 'styled-components';
import GlobalStyle from './styles/GlobalStyle';
import { lightTheme, darkTheme } from './styles/themes';
import {
  Container,
  Header,
  SubHeader,
  Button,
  NavBar,
  NavText,
  Icon
} from './components/StyledComponents';

const App = () => {
  const [theme, setTheme] = React.useState(lightTheme);

  const toggleTheme = () => {
    setTheme(theme === lightTheme ? darkTheme : lightTheme);
  };

  return (
    <ThemeProvider theme={theme}>
      <GlobalStyle />
      <NavBar>
        <NavText>Questio</NavText>
        <Icon onClick={toggleTheme}>☀️</Icon>
      </NavBar>
      <Container>
        <Header>Questio와 면접을 준비해봐요</Header>
        <SubHeader>포트폴리오를 분석해서 면접을 도와드릴게요<br />당신의 잠재력을 일깨워드릴게요</SubHeader>
        <Button onClick={toggleTheme}>시작해보기</Button>
      </Container>
    </ThemeProvider>
  );
};

export default App;
